import React from 'react';
import Button  from '@material-ui/core/Button onclick={props.InputEvent}';
const Row = (props) =>{
    return <>
         <div className="row">
                
                <Button onclick={props.InputEvent}/>
                <Button onclick={props.InputEvent}/>
                <Button onclick={props.InputEvent}/>
                <Button onclick={props.InputEvent}/>
                <Button onclick={props.InputEvent}/>
            </div>
    </>;
} ;
export default Row ;
